import React, {useContext} from 'react';
import styled from "styled-components";
import { GlobalContext } from '../context/GlobalState';

const CSS = styled.div`
  width: fit;
  background: transparent;

  .search-item{
    width:100%;
    text-align: left;


    border: 1px solid transparent;
    background: #164a41;
    padding: 8px;
    border-radius: 0px;
    padding-right: 30px;
    color: #DDD;  

    font-size: 16px;
      line-height: 18px;

      color: #F1B24A;
      text-transform: uppercase;
      font-weight: 520;
      letter-spacing: 1.5px;


  }

  .company-name{
    color: white;
  }
`;

//graphSymbol(mySymbol.symbol, 'day', true)
export const SearchItem = ({ mySymbol }) => {
  const { graphSymbol } = useContext(GlobalContext);

  return (
    <div>
      <CSS>
        <button className="search-item" onClick={() => graphSymbol(mySymbol.symbol, 'day', true)}>
          <p>({mySymbol.symbol})<span className="company-name"> {mySymbol.name}</span></p>
        </button>
      </CSS>
    </div>
  )
}
